import React from 'react'

function Prob3() {
    return (
        <div>
            <img src="images/" />
           <p className="probp">The next three problems gradually increase in difficulty, and all of them are more challenging than the warm-ups you just solved.</p>
           <p className="probp">It's worth the effort. The most effective learning experiences are often those times when you get a problem wrong, and then challenge yourself to read, understand, and learn from the solution.</p>
        </div>
    )
}

export default Prob3
